"use strict";Vue.component("ht-tree",{props:{url:{type:String,require:!0},setting:{require:!1,type:Object},tid:{require:!1,type:String,default:function(){return"ztree"+Math.random()*Date.parse(new Date)}}},data:function(){return{defaultSetting:{data:{simpleData:{enable:!0}}},nodeData:[{id:1,pId:0,name:"库位组1",open:!0},{id:11,pId:1,name:"库位1"},{id:12,pId:1,name:"库位22222"},{id:2,pId:0,name:"库位组2",open:!0},{id:21,pId:2,name:"库位3"},{id:22,pId:2,name:"库位4"},{id:221,pId:22,name:"库位5"}]}},methods:{loadData:function(){var a=this,n=Object.assign({},{callback:this.evalCallback},this.defaultSetting,this.setting);$.ajax({type:"POST",url:a.url||"http://www.baidu.com",contentType:"application/json",dataType:"json",success:function(t){$.fn.zTree.init($("#"+a.tid),n,a.nodeData);var e=$.fn.zTree.init($("#"+a.tid),n,a.nodeData);a.$parent.$ztree=e},error:function(t){$.fn.zTree.init($("#"+a.tid),n,a.nodeData);var e=$.fn.zTree.init($("#"+a.tid),n,a.nodeData);a.$parent.$ztree=e}})},evalCallback:function(){var a=this,n={};return $.each(this.setting.callback,function(t,e){console.log(t,e),n[t]=a.$parent[e]}),n}},mounted:function(){this.loadData()},template:'  <div>           \n       <ul :id="tid" class="ztree"></ul>\n   </div>'});